    //       imageRef.getDownloadUrl().then(function(url){
    //            return <img src={url} />
    //       }).catch(function(error){
    //             console.log(error)
    //       })

 
    let video='';
    if(url2!==''){
        video=<video controls>
                <source src={url2}
                type="video/mp4"></source>
            </video>
    }
    return (
        <div className="cards">
            
            <div className="element">
                <input type="file" onChange={onChange}/>
                {/* {video} */}
            </div>

            <input type="file" onChange={onChange}/>
            {video}

            
        </div>
    )
}
